window.testFuncGen = function () {
    "use strict";
    var getNeighboorhood = function (nx, ny, rounding) {
        var x0 = rounding((nx - 1) / 2), y0 = rounding((ny - 1) / 2);

        var offsets = "var ";
        for (var yx = 0, y_ = 0, y_e = ny, y = -y0; y_ < y_e; y_++, y++) {
            for (var yx = y_, x = -x0, yxe = y_ + nx * ny; yx < yxe; yx += ny, x++) {
                var xstr = (x === 0 ? "" : x + " * ny"),
                    ystr = (y === 0 ? "" : (y > 0 ? (x === 0 ? y : " + " + y) : (x === 0 ? y : " - " + (-y))));
                xstr = (x === 0 && y === 0) ? "0" : xstr;
                offsets += "o" + (y + y0) + (x + x0) + " = " + xstr + ystr + ", "
            }
            offsets += "\n    ";
        }
        offsets = offsets.slice(0, -7) + ";";

        var values = "var ";
        for (var _x = 0, x = -x0, xe = nx * ny; _x < xe; _x += ny, x++) {
            for (var yx = _x, y = -y0, yxe = _x + ny; yx < yxe; yx++, y++) {
                var xstr = (x === 0 ? "" : x + " * ny + "),
                    ystr = (y === 0 ? "" : y);
                xstr = (x === 0 && y === 0) ? "0" : xstr;
                values += "v" + (y + y0) + (x + x0) + " = id[yx + o" + (y + y0) + (x + x0) + "], "
            }
            values += "\n    ";
        }
        values = values.slice(0, -7) + ";";

        return {
            "offsets": offsets,
            "values": values
        };
    };
    var txt = getNeighboorhood(7, 7, Math.floor)
    console.log(txt.offsets);
    console.log(txt.values);
};

